        .disable_select {
            -ms-user-select: none; /* IE 10+ */
            -moz-user-select: -moz-none;
            -khtml-user-select: none;
            -webkit-user-select: none;
            user-select: none;
        }

        .gameend_overlay {
            animation-duration: 0.1s;
            animation-fill-mode:forwards;
        }
        .gameend_overlay[data="closed"] {
            opacity:0;
            display:none;
        }
        .gameend_overlay[data="show"] {
            animation-name: showOverlay;
        }
        .gameend_overlay[data="show"] > .contents {
            animation-name: showOverlay-d;
        }
        .gameend_overlay[data="hide"] {
            animation-name: hideOverlay;
        }
        .gameend_overlay[data="hide"] > .contents {
            animation-name: hideOverlay-d;
        }

        .grayfilter {
            fill: black;
            opacity: .7;
        }

        .disclaimer text,
        .youtube_api text,
        .privacy_policy text,
        .credit text {
            fill:white;
            font-size:20px;
            user-select: text;
        }

        .senseki,
        .link {
            cursor: pointer;
            text-decoration: underline;
        }

        .bottom_credits {
            user-select: text;
        }

        @keyframes showOverlay {
            0% {
                opacity:0;
            }
            100% {
                opacity:1;
            }
        }
        @keyframes showOverlay-d {
            0% {
                opacity:0;
            }
            50% {
                opacity:0;
            }
            100% {
                opacity:1;
            }
        }
        @keyframes hideOverlay {
            0% {
                opacity:1;
            }
            100% {
                opacity:0;
            }
        }
        @keyframes hideOverlay-d {
            0% {
                opacity:1;
            }
            50% {
                opacity:0;
            }
            100% {
                opacity:0;
            }
        }

        .word_button {
