            <g class="policy" v-if="mode == 'policy'">
                <g class="privacy_policy" transform="translate(200 160)">
                    <text transform="translate(0 0)">プライバシーポリシー</text>
                    <text transform="translate(0 24)">アクセス解析ツールについて</text>
                    <text transform="translate(0 48)">当サイトでは、Googleによるアクセス解析ツール「Googleアナリティクス」を利用しています。</text>
                    <text transform="translate(0 72)">Googleアナリティクスはトラフィックデータの収集のためにCookieを使用しています。</text>
                    <text transform="translate(0 96)">このトラフィックデータは匿名で収集されており個人を特定するものではありません。</text>
                    <text transform="translate(0 120)">この機能はCookieを無効にすることで収集を拒否することが出来ます。</text>
                    <text transform="translate(0 144)">Cookieの無効化状態はお使いのブラウザの設定をご確認ください。</text>
                    <text transform="translate(0 168)">この規約に関してはGoogleアナリティクス利用規約(<tspan class="link" v-on:click="open('https://marketingplatform.google.com/about/analytics/terms/jp/')">https://marketingplatform.google.com/about/analytics/terms/jp/</tspan>)をご確認ください。</text>
                </g>
                <g class="youtube_api" transform="translate(200 400)">
                    <text transform="translate(0 0)">YouTube Data APIの利用について</text>
                    <text transform="translate(0 24)">当サイトでは、チャンネル・動画の情報を取得するためにYouTube Data APIを利用しています。</text>
                    <text transform="translate(0 48)">YouTube Data APIは、YouTubeの利用規約、 およびGoogleのプライバシーポリシーに基づいて提供されています。</text>
                    <text transform="translate(0 72)">YouTubeの利用規約に関して詳しくはYouTube利用規約(<tspan class="link" v-on:click="open('https://www.youtube.com/t/terms')">https://www.youtube.com/t/terms</tspan>)をクリックしてください。</text>
                    <text transform="translate(0 96)">Googleのプライバシーポリシーに関して詳しくはGoogleプライバシーポリシー(<tspan class="link" v-on:click="open('https://policies.google.com/privacy')">https://policies.google.com/privacy</tspan>)をクリックしてください。</text>
                </g>
                <g class="disclaimer" transform="translate(200 550)">
                    <text transform="translate(0 0)">免責事項</text>
                    <text transform="translate(0 24)">当サイトで掲載している画像の著作権・肖像権等は各権利所有者に帰属致します。権利を侵害する目的はありません。</text>
                    <text transform="translate(0 48)">記事の内容や掲載画像等に問題がございましたら、各権利所有者様が<tspan class="link" v-on:click="open('https://twitter.com/OIL_STAND')">開発者のTwitterアカウント</tspan>へご連絡下さい。</text>

                    <text transform="translate(0 72)">当サイトからリンクやバナーなどによって他のサイトに移動された場合、移動先サイトで提供される情報、サービス等について一切の責任を負いません。</text>
                    <text transform="translate(0 96)">当サイトのコンテンツ・情報につきまして、可能な限り正確な情報を掲載するよう努めておりますが、誤情報が入り込んだり情報が古くなっていることもあります。</text>
                    <text transform="translate(0 120)">当サイトに掲載された内容によって生じた損害等の一切の責任を負いかねますのでご了承ください。</text>
                </g>
