                <text v-show="select_word == 10" class="lm"  transform="translate(709 296.05)">求めていたものが来たときやファインプレーがあったときに発する歓喜の言葉<tspan class="ky" x="673.56" y="0">。</tspan><tspan x="698" y="0">流行語入りを目指していたらし</tspan><tspan x="0" y="30">いが</tspan><tspan class="ky" x="40.85" y="30">、</tspan><tspan x="65.3" y="30">本人も最近は使っていない。</tspan></text>
                <text v-show="select_word == 9" class="lm"  transform="translate(709 296.05)">湊あくあ発案の日本人レジェンド<tspan class="ky" x="284.24" y="0">。</tspan><tspan x="308.68" y="0">カバンが大きく</tspan><tspan class="ky" x="437.23" y="0">、</tspan><tspan x="461.67" y="0">ウルトで金アイテムを入手できるらしい。ヴァルキリーも来</tspan><tspan x="0" y="30">るので実装は無いだろう。</tspan></text>
                <text v-show="select_word == 8" class="lm" transform="translate(709 296.05)">マッチングで人数が欠けたときなどにマッチ参加ポイントが免除されること。</text>
