<script>

export default {
    data () {
        return {
            scale: 1,
            width: 1920,
            height: 1080,
            fontSize: 16,
            elmParent: false,
            aspect: (1920 / 1080),
            gameEnd: 'closed',
            elmOverlay: false,
            bannerType: 0,
            intervalHandle: false,
            rp: -1,
            apexVideos: [],
            rankLog: [],    // グラフ用
            graphMark: [],
            mode: 'play',
            overlay_mode: '',
            vid: 'NLPMrKgcI8E',
            newestVid: 'NLPMrKgcI8E',
            select_word: 0,
            season: '',
            seasonNow: 's12s1',
            graphD: '',
            yZero: 900, xZero: 205, yRpScale: 1, yBase: -1  // グラフ用
        }
    },
    methods: {
        gotoTop() {
            this.$router.push('/');
        },
        open(url) {
            window.open(url);
        },
        clickBanner(id) {
            switch(id) {
                case 0:
                    window.open('https://akukin.jp/');
                    break;
                case 1:
                    window.open('https://twitter.com/minatoaqua');
                    break;
                case 2:
                    window.open('https://www.youtube.com/channel/UC1opHUrw8rvnsadT-iGp7Cg');
                    break;
            }
            
        },
        clickShareButton() {
            window.open('https://twitter.com/intent/tweet?text=%E3%80%90%E9%9D%9E%E5%85%AC%E5%BC%8F%E3%80%91%E6%B9%8A%E3%81%82%E3%81%8F%E3%81%82+APEX+%E3%82%BD%E3%83%AD%E3%83%9E%E3%82%B9%E3%82%BF%E3%83%BC%E3%83%81%E3%83%A3%E3%83%AC%E3%83%B3%E3%82%B8%EF%BD%9CAquPEX+Legends&url=https://'+document.domain);
        },
        nextBanner() {
            this.bannerType = (this.bannerType + 1) % 3;
        },
        changeBanner( type ) {
            this.resetInterval();
            this.bannerType = type;
        },
        resetInterval() {
            if(this.intervalHandle) {
                clearInterval(this.intervalHandle);
                this.intervalHandle = false;
            }
            this.intervalHandle = setInterval(()=>{
                this.nextBanner();
            },5*1000);
        },
        showNewestVideoOverlay() {
            this.vid = this.newestVid;
            this.showVideoOverlay();
        },
        showVideoOverlay() {
            this.overlay_mode = 'videoplay';
            this.showOverlay();
            window.setTimeout(()=>{
                this.showVideo();
            },300);
        },
        closeVideoOverlay() {

        },
        showVideo() {
            const elmParent = document.getElementById('video');
        },
        showOverlay() {
            this.gameEnd = 'show';
        },
        hideOverlay() {
            this.gameEnd = 'hide';
            window.setTimeout(()=>{
                this.gameEnd = 'closed';
            },300);
        },
        onResize(e) {
            if(this.elmParent) {
                if(
                    (this.elmParent.clientWidth / this.elmParent.clientHeight) > this.aspect
                ) {
                    // 幅が大きい
                    this.height = this.elmParent.clientHeight;
                    this.width = this.elmParent.clientHeight * this.aspect;
                } else {
                    // 高さが大きい
                    this.height = this.elmParent.clientWidth * ( 1 / this.aspect );
                    this.width = this.elmParent.clientWidth;
                }
                this.scale = this.width / 1920;
                this.fontSize = 16 * this.scale;
            }
        },
        updateRp() {
            this.$api.request("apexRank/minatoaqua")
                .then(res=>{
                    //console.log("rp res",res)
                    if( res && res.status == 200 && res.data && res.data.rp != undefined ) {
                        console.log("rp:"+res.data.rp)
                        if(this.rp != res.data.rp) {
                            this.rp = res.data.rp;
                            if(this.season == this.seasonNow) {
                                this.updateHistory();
                            }
                        }
                    }
                });
        },
        changeSeason(season) {
            if(season != this.season) {
                this.season = season
                this.updateHistory()
            }
        },
        updateHistory() {
            this.$api.request("apexRankLog/"+this.season+"/minatoaqua")
                .then(res=>{
                    if( res && res.status == 200 && res.data && res.data.log ) {
                        //console.log('update history');
                        //let border = new Date('2022-01-01 00:00:00+09:00'.replace(/-/g,"/"));
                        //let logs = res.data.log.filter(o=>new Date(o.createdAt.replace(/-/g,"/")) > border)
                        this.rankLog = res.data.log.reverse();
                        //console.log(res.data.log,logs);
                    }
                });
        },
        async getrp() {
            this.updateRp();

            setInterval(()=>{
                //console.log('rp update');
                this.updateRp();
            }, 5*60*1000);


            this.$api.request("channelVideos/UC1opHUrw8rvnsadT-iGp7Cg")
                .then(res=>{
                    if( res && res.status == 200 && res.data && res.data.data ) {
                        let videos = res.data.data;
                        this.apexVideos = videos.filter(v=> v.title.indexOf('APEX') != -1);
                        /*this.vid = this.apexVideos && this.apexVideos[0] && this.apexVideos[0].id ? this.apexVideos[0].id : '1kxCz6tt2MU';*/
                        this.newestVid = this.apexVideos && this.apexVideos[0] && this.apexVideos[0].id ? this.apexVideos[0].id : '1kxCz6tt2MU';
                    }
                });

        },
        makeLineData(rp, text) {
            let y = (this.yZero - (rp - this.yBase) * this.yRpScale).toFixed(2);
            if(y >= 0 && y <= 1080) {
                return {'y':y,'text':text};
            }
            return false;
        },
        getRankNo( rp ) {
            const rankTbl = [
                {'base':10000,  'step':30000,   'no':50 },  //M
                {'base':7200,   'step':700,     'no':40 },  //D
                {'base':4800,   'step':600,     'no':30 },  //P
                {'base':2800,   'step':500,     'no':20 },  //G
                {'base':1200,   'step':400,     'no':10 },  //S
                {'base':0,      'step':300,     'no':0 },   //B
            ];
            for(let rule of rankTbl) {
                if(rp >= rule.base) {
                    return Math.floor((rp - rule.base) / rule.step) + rule.no;
                }
            }
            return -1;
        },
        getEntryFee( rankNo ) {
            const feeTbl = [
                {'fee':60,  'no':50 },  //M
                {'fee':48,  'no':40 },  //D
                {'fee':36,  'no':30 },  //P
                {'fee':24,  'no':20 },  //G
                {'fee':12,  'no':10 },  //S
                {'fee':0,   'no':0 },   //B
            ];
            for(let rule of feeTbl) {
                if(rankNo >= rule.no) {
                    return rule.fee;
                }
            }
            return -1;
        }
    },
    computed: {
        rank() {
            let no = this.getRankNo(this.rp);
            switch(Math.floor(no / 10)) {
                case 0: return 'bronse';
                case 1: return 'silver';
                case 2: return 'gold';
                case 3: return 'platinum';
                case 4: return 'diamond';
                case 5: return 'master';
                default: return '';
            }
        },
        rankM() {
            let no = this.getRankNo(this.rp);
            switch(Math.floor(no / 10)) {
                case 0: return 'ブロンズ';
                case 1: return 'シルバー';
                case 2: return 'ゴールド';
                case 3: return 'プラチナ';
                case 4: return 'ダイアモンド';
                case 5: return 'マスター';
                default: return '';
            }
        },
        stage() {
            let no = this.getRankNo(this.rp);
            if(no >= 50)return '';
            switch(no%10) {
                case 0:
                    return 'Ⅳ';
                case 1:
                    return 'Ⅲ';
                case 2:
                    return 'Ⅱ';
                case 3:
                    return 'Ⅰ';
                default:
                    return '';
            }
        },
        nextStageRp() {
            let table = [300,600,900,1200,1600,2000,2400,2800,3300,3800,4300,4800,5400,6000,6600,7200,7900,8600,9300,10000];
            for(let i = 0; i < table.length; i++) {
                if(this.rp < table[i]) {
                    return table[i];
                }
            }
            return 10000;
        },
        stageLength() {
            switch(this.rank) {
                case 'bronse':      return 300;
                case 'silver':      return 400;
                case 'gold':        return 500;
                case 'platinum':    return 600;
                case 'diamond':     return 700;
                default:
                    return 10000;
            }
        },
        progress() {
            return (1 - (this.nextStageRp - this.rp) / this.stageLength) * 230;
        },
        graphData() {
            const yTop = 215;
            const offset = 6;
            let xBase = 0;
            let retD = "";

            let yTopRp = 10000;
            this.yBase = -1

            let max = Math.max.apply(null,this.rankLog.map((o)=>{return o.rp;}))
            let min = Math.min.apply(null,this.rankLog.map((o)=>{return o.rp;}))

            console.log(min,max)

            if(max < 4800) {
                yTopRp = 5400;
            } else if(max < 7200) {
                yTopRp = 7900
            }

            for(let i = 0; i < this.rankLog.length; i++) {
                if(this.yBase == -1) {
                    this.yBase = min;//this.rankLog[i].rp;
                    this.yRpScale = (this.yZero - yTop) / (yTopRp - this.yBase);
                    retD += ""+this.xZero+","+this.yZero;
                    continue;
                }
                let x = this.xZero + i * offset;
                let y = (this.yZero - (this.rankLog[i].rp - this.yBase) * this.yRpScale).toFixed(2);
                retD += " "+x+","+y;
            }
            //graphMark
            retD += "";
            return retD;
        },
        graphLineData() {
            let lineD = [];
            if(true /*this.yBase != -1*/) {
                let m = this.makeLineData(10000, '10,000RP(Master)');
                if(m) lineD.push(m);

                let d4 = this.makeLineData(7200, '7,200RP(Diamond)');
                if(d4) lineD.push(d4);

                let d3 = this.makeLineData(7900, '7,900RP(DⅢ)');
                if(d3) lineD.push(d3);

                let d2 = this.makeLineData(8600, '8,600RP(DⅡ)');
                if(d2) lineD.push(d2);

                let d1 = this.makeLineData(9300, '9,300RP(DⅠ)');
                if(d1) lineD.push(d1);

                let p4 = this.makeLineData(4800, '4,800RP(Platinum)');
                if(p4) lineD.push(p4);

                let p3 = this.makeLineData(5400, '5,400RP(PⅢ)');
                if(p3) lineD.push(p3);

                let p2 = this.makeLineData(6000, '6,000RP(PⅡ)');
                if(p2) lineD.push(p2);

                let p1 = this.makeLineData(6600, '6,600RP(PⅠ)');
                if(p1) lineD.push(p1);

                let g4 = this.makeLineData(2800, '2,800RP(Gold)');
                if(g4) lineD.push(g4);

                let g3 = this.makeLineData(3300, '3,300RP(GⅢ)');
                if(g3) lineD.push(g3);

                let g2 = this.makeLineData(3800, '3,800RP(GⅡ)');
                if(g2) lineD.push(g2);

                let g1 = this.makeLineData(4300, '4,300RP(GⅠ)');
                if(g1) lineD.push(g1);

                let s4 = this.makeLineData(1200, '1,200RP(Silver)');
                if(s4) lineD.push(s4);

                let s3 = this.makeLineData(1600, '1,600RP(SⅢ)');
                if(s3) lineD.push(s3);

                let s2 = this.makeLineData(2000, '2,000RP(SⅡ)');
                if(s2) lineD.push(s2);

                let s1 = this.makeLineData(2400, '2,400RP(SⅠ)');
                if(s1) lineD.push(s1);
                
                let b3 = this.makeLineData(300, '300RP(BⅢ)');
                if(b3) lineD.push(b3);

                let b2 = this.makeLineData(600, '600RP(BⅡ)');
                if(b2) lineD.push(b2);

                let b1 = this.makeLineData(900, '900RP(BⅠ)');
                if(b1) lineD.push(b1);

            }
            return lineD;
        },
        rankPointHistory() {
            const scoreTbl = [
                { 'rp': 0,  'res': '#14+(0)' },
                { 'rp': 5,  'res': '#13-11(0)' },
                { 'rp': 10, 'res': '#10,9(0) / #14+(1)' },
                { 'rp': 15, 'res': '#13-11(1)' },
                { 'rp': 20, 'res': '#8,7(0) / #14+(2)' },
                { 'rp': 22, 'res': '#10,9(1)' },
                { 'rp': 25, 'res': '#13-11(2)' },
                { 'rp': 30, 'res': '#6,5(0) / #14+(3)' },
                { 'rp': 32, 'res': '#8,7(1)' },
                { 'rp': 34, 'res': '#10,9(2)' },
                { 'rp': 35, 'res': '#13-11(3)' },
                { 'rp': 40, 'res': '#4,3(0) / #14+(4)' },
                { 'rp': 42, 'res': '#6(1)' },
                { 'rp': 44, 'res': '#8,7(2)' },
                { 'rp': 45, 'res': '#5(1) / #13-11(4)' },
                { 'rp': 46, 'res': '#10,9(3)' },
                { 'rp': 50, 'res': '#14+(5)' },
                { 'rp': 54, 'res': '#6(2)' },
                { 'rp': 55, 'res': '#4(1) / #13-11(5)' },
                { 'rp': 56, 'res': '#8,7(3)' },
                { 'rp': 58, 'res': '#10,9(4)' },
                { 'rp': 60, 'res': '#2(0) / #3(1) / #5(2) / #14+(6)' },
                { 'rp': 65, 'res': '#13-11(6)' },
                { 'rp': 66, 'res': '#6(3)' },
                { 'rp': 68, 'res': '#8,7(4)' },
                { 'rp': 70, 'res': '#4(2) / #10,9(5)' },
                { 'rp': 75, 'res': '#5(3)' },
                { 'rp': 78, 'res': '#6(4)' },
                { 'rp': 80, 'res': '#2(1) / #3(2) / #8,7(5)' },
                { 'rp': 82, 'res': '#10,9(6)' },
                { 'rp': 85, 'res': '#4(3)' },
                { 'rp': 90, 'res': '#5(4) / #6(5)' },
                { 'rp': 92, 'res': '#8,7(6)' },
                { 'rp': 100,'res': '#1(0) / #2(2) / #3(3) / #4(4)' },
                { 'rp': 102,'res': '#6(6)' },
                { 'rp': 105,'res': '#5(5)' },
                { 'rp': 115,'res': '#4(5)' },
                { 'rp': 120,'res': '#2(3) / #3(4) / #5(6)' },
                { 'rp': 125,'res': '#1(1)' },
                { 'rp': 130,'res': '#4(6)' },
                { 'rp': 140,'res': '#2(4) / #3(5)' },
                { 'rp': 150,'res': '#1(2)' },
                { 'rp': 160,'res': '#2(5) / #3(6)' },
                { 'rp': 175,'res': '#1(3)' },
                { 'rp': 180,'res': '#2(6)' },
                { 'rp': 200,'res': '#1(4)' },
                { 'rp': 225,'res': '#1(5)' },
                { 'rp': 250,'res': '#1(6)' },
            ];
            let res = [];
            for(let log of this.rankLog) {
                let text = "";
                if(log.matchInfo && log.matchInfo.rpDiff && Math.abs(log.matchInfo.rpDiff) <= 275) {
                    if(this.season == "s8") {
                        let preRp = log.rp - log.matchInfo.rpDiff;
                        let rankNo = this.getRankNo(preRp);
                        let fee = this.getEntryFee(rankNo);
                        const data = scoreTbl.find(r=> (r.rp - fee) == log.matchInfo.rpDiff);
                        if(data) {
                            text = data.res;
                        } else {
                            text = "Err";
                        }
                    } else {
                        text = "";
                    }
                } else {
                    if(log.matchInfo.rpDiff < -1000) {
                        text = "Rank Reset";
                    } else {
                        text = "---"
                    }
                }
                res.push({'rp':log.rp, 'text':text, 'rpDiff':log.matchInfo && log.matchInfo.rpDiff ? log.matchInfo.rpDiff : false});
            }
            
            return res.reverse();
        }
    },
    components: {},
    mounted() {
        this.season = this.seasonNow

        this.elmParent = document.getElementById('page_container').parentNode;
        window.addEventListener( 'resize', this.onResize, false );
        this.onResize();

        this.resetInterval();

        this.getrp();

        this.showVideoOverlay();
    },
    head() {
        return {
            title: '【非公式】湊あくあ APEX ソロマスターチャレンジ',
            meta: [
                { hid: 'og:card', property: 'og:type', content: 'summary_large_image' },
                { hid: 'og:image', property: 'og:image', content: 'https://apex.akukin.jp/ogp_home.png' },
            ],
            script: [
            ]
        }
    },
}
</script>
